import React from 'react';
import Card from '../../../../../UI/Card/Card';
import classes from './PatientItem.module.css'; // Import the CSS module

function PatientItem(props) {
    return (
        <Card>
            <div className={classes.patientItem}>
                <h1 className={classes.name}>{props.name}</h1>
                <p className={classes.age}>Age: {props.age}</p>
                <p className={classes.lastVisitReason}>Last Visit Reason: {props.lastVisitReason}</p>
            </div>
        </Card>
    );
}

export default PatientItem;
